import { createAction } from "redux-actions";
import { GET_USER_PROFILE, GET_USER_PROFILE_ERROR, GET_USER_PROFILE_SUCCESS } from "./types";

export const authActionCreator = {
  registerUser: createAction(GET_USER_PROFILE, async (payload) => {
    // this callback will be called when action is dis-patched.
    await (payload);
  }),
  registerUserSuccess: createAction(GET_USER_PROFILE_SUCCESS),
  registerUserFailed: createAction(GET_USER_PROFILE_ERROR),
};
